import React from "react";
import { Link } from "react-router-dom";
import { myObj } from "../constants/movieDB";

const MovieList = () => {
  const { movies } = myObj;
  console.log(movies);
  return (
    <div>
      MovieList
      <Link to="/movies">Movie Details</Link>
    </div>
  );
};

export default MovieList;
